import useState from "react";
import UserList from "./UserList";
import "./Users.css";

const Users = (props) => {
  const [userArray, setUserArray] = useState([UserList]);

  let content = <p>No Current Users</p>;

  if (userArray.length > 0) {
    content = <UserList />;
  }

  return <ul>{content}</ul>;
};

export default Users;
